import { NavLink } from "react-router-dom"

import './Header.css'
import { useUser } from "../hooks/UserContext"

function Header() {
  const [user] = useUser()
  return (
    <header id="top-bar">
      <div>
        <NavLink to="/">Inicio</NavLink>
        <NavLink to="/register">Registro</NavLink>
        <NavLink to="/list">Lista de tareas</NavLink>
        {user && <NavLink to="/newtask">Nueva tarea</NavLink>}
      </div>

    </header>
  )
}

export default Header
